selector_to_html = {"a[href=\"../lecture-2/exercise-2.5-solutions.html#ref-lec2-ex5-sol\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Solutions of Exercise 2.5<a class=\"headerlink\" href=\"#solutions-of-exercise-2-5\" title=\"Link to this heading\">#</a></h1><p>We are trying to design the controller for the system:</p>", "a[href=\"#alternative-solution-the-routh-criterion\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Alternative solution: the Routh criterion<a class=\"headerlink\" href=\"#alternative-solution-the-routh-criterion\" title=\"Link to this heading\">#</a></h4><p>To check the stability of <span class=\"math notranslate nohighlight\">\\(G_c(s)\\)</span> we can apply the Routh criterion as done in the <a class=\"reference internal\" href=\"../lecture-2/exercise-2.5-solutions.html#ref-lec2-ex5-sol\"><span class=\"std std-ref\">Solutions of Exercise 2.5</span></a>.</p><p>To do so, let\u2019s first compute <span class=\"math notranslate nohighlight\">\\(G_c(s)\\)</span>:</p>", "a[href=\"#solution\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Solution<a class=\"headerlink\" href=\"#solution\" title=\"Link to this heading\">#</a></h2><h3>Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>Since the order of the closed-loop transfer function <span class=\"math notranslate nohighlight\">\\(G_c(s) = \\frac{F(s) G(s)}{1 + F(s) G(s)}\\)</span> is three, we can\u2019t easily provide an analytical solution. We therefore inspect the root locus.</p>", "a[href=\"#question-2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2<a class=\"headerlink\" href=\"#question-2\" title=\"Link to this heading\">#</a></h3><h4>Phase margin<a class=\"headerlink\" href=\"#phase-margin\" title=\"Link to this heading\">#</a></h4><p>Let\u2019s start by computing the <strong>phase margin</strong>, which is defined as</p>", "a[href=\"#solutions-of-exercise-3-2\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Solutions of Exercise 3.2<a class=\"headerlink\" href=\"#solutions-of-exercise-3-2\" title=\"Link to this heading\">#</a></h1><p>A vehicle is characterized by the following transfer function, which relates the throttle input  <span class=\"math notranslate nohighlight\">\\(U(s)\\)</span>  to the velocity  <span class=\"math notranslate nohighlight\">\\(Y(s)\\)</span>,</p>", "a[href=\"#gain-margin\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Gain margin<a class=\"headerlink\" href=\"#gain-margin\" title=\"Link to this heading\">#</a></h4><p>We can then proceed computing the <strong>gain margin</strong>, which is defined as</p>", "a[href=\"#question-1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>Since the order of the closed-loop transfer function <span class=\"math notranslate nohighlight\">\\(G_c(s) = \\frac{F(s) G(s)}{1 + F(s) G(s)}\\)</span> is three, we can\u2019t easily provide an analytical solution. We therefore inspect the root locus.</p>", "a[href=\"#phase-margin\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Phase margin<a class=\"headerlink\" href=\"#phase-margin\" title=\"Link to this heading\">#</a></h4><p>Let\u2019s start by computing the <strong>phase margin</strong>, which is defined as</p>", "a[href=\"#equation-eq-lec3-ex2-phase\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-lec3-ex2-phase\">\n\\[\n\\angle G_o(i \\omega) := \\varphi(0) + \\sum_{i} \\textrm{atan} \\left( \\frac{\\omega}{p_i} \\right) - \\sum_{i} \\textrm{atan} \\left( \\frac{\\omega}{z_i} \\right) = -180^\\circ\n\\]</div>", "a[href=\"../lecture-1/useful-formulas.html#ref-lec1-useful-formulas\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Useful formulas<a class=\"headerlink\" href=\"#useful-formulas\" title=\"Link to this heading\">#</a></h1><p>Before continuing with the exercises, we deem it useful to summarize some useful formula to interpret how the parameters of the transfer function affect the \u201ccharacteristics\u201d of the systems.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: false,
                placement: 'auto-start', maxWidth: 500, interactive: true, boundary: document.body, appendTo: document.body,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {var isFirefox=typeof InstallTrigger!=='undefined';if(isFirefox&&window.MathJax&&MathJax.startup&&MathJax.startup.output&&MathJax.startup.output.name==="SVG"){const svgs=instance.popper.querySelectorAll('svg');svgs.forEach(svg=>{let bbox=svg.getBBox(),x=bbox.x,y=bbox.y,width=bbox.width,height=bbox.height;svg.setAttribute('width',width);svg.setAttribute('height',height);svg.setAttribute('viewBox',`${x} ${y} ${width} ${height}`);});let rescale=0.015;svgs.forEach(svg=>{let bbox=svg.getBBox(),width=bbox.width,height=bbox.height;svg.setAttribute('width',width*rescale);svg.setAttribute('height',height*rescale);});}});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
